// Modules //
import React from 'react';
import axios from 'axios';
import Fade from 'react-reveal/Fade';

// Style //
import { Container, Col, Row, Card } from 'react-bootstrap';
import './Projets.scss';

class Contact extends React.Component {

  render() {
    return (
      <div className="div_projets">
        <Container>
            <Row>
            <Fade cascade>
            <Col>
            <h2 className="h2_projets">Projets au seins du Samsung Campus</h2>
            <h3 className="h3_projets">Liste non exhaustive</h3>
                <Card className="border-0">
                    <Card.Body className="">
                        <Card.Title>Anglais</Card.Title>
                        <Card.Subtitle>Samsung Campus, Saint-Ouen</Card.Subtitle>
                        <Card.Title>Japonais</Card.Title>
                        <Card.Subtitle>Samsung Campus, Saint-Ouen</Card.Subtitle>
                    </Card.Body>
                </Card>
                </Col>
            </Fade>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Contact;
